          when OP_WRITE_0_10 =>
            STATE_10 <= WRITE_STREAM_0;
            PC_10 <= PC_10;
          when OP_WRITE_2_10 =>
            STATE_10 <= WRITE_STREAM_2;
            PC_10 <= PC_10;
          when OP_WRITE_8_10 =>
            STATE_10 <= WRITE_STREAM_8;
            PC_10 <= PC_10;
          when OP_WRITE_9_10 =>
            STATE_10 <= WRITE_STREAM_9;
            PC_10 <= PC_10;
          when OP_READ_5_10 =>
            STATE_10 <= READ_STREAM_5;
            PC_10 <= PC_10;
            DEST := to_integer(unsigned(SRCA_10));
          when OP_READ_7_10 =>
            STATE_10 <= READ_STREAM_7;
            PC_10 <= PC_10;
            DEST := to_integer(unsigned(SRCA_10));
          when OP_READ_1_10 =>
            STATE_10 <= READ_STREAM_1;
            PC_10 <= PC_10;
            DEST := to_integer(unsigned(SRCA_10));
          when OP_READ_3_10 =>
            STATE_10 <= READ_STREAM_3;
            PC_10 <= PC_10;
            DEST := to_integer(unsigned(SRCA_10));

          when others => null;
        end case;

        --write back results
        if RESULT = "00000000000000000000" then
          ZERO_10 <= '1';
        else
          ZERO_10 <= '0';
        end if;
      when READ_STREAM_5 =>
        if STREAM_5_STB = '1' then
          STREAM_5_ACK <= '1';
          REGISTERS_10(DEST) <= STD_RESIZE(STREAM_5, 20);
          STATE_10 <= ACK_STREAM_5;
        end if;
      when ACK_STREAM_5 =>
        STREAM_5_ACK <= '0';
        STATE_10 <= EXECUTE;
        PC_10 <= PC_10 + 1;
      when READ_STREAM_7 =>
        if STREAM_7_STB = '1' then
          STREAM_7_ACK <= '1';
          REGISTERS_10(DEST) <= STD_RESIZE(STREAM_7, 20);
          STATE_10 <= ACK_STREAM_7;
        end if;
      when ACK_STREAM_7 =>
        STREAM_7_ACK <= '0';
        STATE_10 <= EXECUTE;
        PC_10 <= PC_10 + 1;
      when READ_STREAM_1 =>
        if STREAM_1_STB = '1' then
          STREAM_1_ACK <= '1';
          REGISTERS_10(DEST) <= STD_RESIZE(STREAM_1, 20);
          STATE_10 <= ACK_STREAM_1;
        end if;
      when ACK_STREAM_1 =>
        STREAM_1_ACK <= '0';
        STATE_10 <= EXECUTE;
        PC_10 <= PC_10 + 1;
      when READ_STREAM_3 =>
        if STREAM_3_STB = '1' then
          STREAM_3_ACK <= '1';
          REGISTERS_10(DEST) <= STD_RESIZE(STREAM_3, 20);
          STATE_10 <= ACK_STREAM_3;
        end if;
      when ACK_STREAM_3 =>
        STREAM_3_ACK <= '0';
        STATE_10 <= EXECUTE;
        PC_10 <= PC_10 + 1;
      when WRITE_STREAM_0 =>
        STREAM_0_STB <= '1';
        STREAM_0 <= STD_RESIZE(REGA, 20);
        if STREAM_0_ACK = '1' then
          STREAM_0_STB <= '0';
          STATE_10 <= EXECUTE;
          PC_10 <= PC_10 + 1;
        end if;
      when WRITE_STREAM_2 =>
        STREAM_2_STB <= '1';
        STREAM_2 <= STD_RESIZE(REGA, 20);
        if STREAM_2_ACK = '1' then
          STREAM_2_STB <= '0';
          STATE_10 <= EXECUTE;
          PC_10 <= PC_10 + 1;
        end if;
      when WRITE_STREAM_8 =>
        STREAM_8_STB <= '1';
        STREAM_8 <= STD_RESIZE(REGA, 20);
        if STREAM_8_ACK = '1' then
          STREAM_8_STB <= '0';
          STATE_10 <= EXECUTE;
          PC_10 <= PC_10 + 1;
        end if;
      when WRITE_STREAM_9 =>
        STREAM_9_STB <= '1';
        STREAM_9 <= STD_RESIZE(REGA, 20);
        if STREAM_9_ACK = '1' then
          STREAM_9_STB <= '0';
          STATE_10 <= EXECUTE;
          PC_10 <= PC_10 + 1;
        end if;

      when DIVIDE_0 =>
        QUOTIENT_10 <= (others => '0');
        SHIFTER_10 <= (others => '0');
        SHIFTER_10(0) <= A_10(19);
        A_10 <= A_10(18 downto 0) & '0';
        COUNT_10 <= 19;
        STATE_10 <= DIVIDE_1;

      when DIVIDE_1 => --subtract
       --if SHIFTER - B is positive or zero
       if REMAINDER_10(19) = '0' then
         SHIFTER_10(19 downto 1) <= REMAINDER_10(18 downto 0);
       else
         SHIFTER_10(19 downto 1) <= SHIFTER_10(18 downto 0);
       end if;
       SHIFTER_10(0) <= A_10(19);
       A_10 <= A_10(18 downto 0) & '0';
       QUOTIENT_10 <= QUOTIENT_10(18 downto 0) & not(REMAINDER_10(19));
       if COUNT_10 = 0 then
         STATE_10 <= DIVIDE_2;
       else
         COUNT_10 <= COUNT_10 - 1;
       end if;

     when DIVIDE_2 =>
      if MOD_DIV_10 = '1' then --if division
        if SIGN_10 = '1' then --if negative
          REGISTERS_10(DEST) <= std_logic_vector(-signed(QUOTIENT_10));
        else
          REGISTERS_10(DEST) <= QUOTIENT_10;
        end if;
      else
        MODULO := unsigned(SHIFTER_10)/2;
        if SIGN_10 = '1' then --if negative
          REGISTERS_10(DEST) <= std_logic_vector(0-MODULO);
        else
          REGISTERS_10(DEST) <= std_logic_vector(  MODULO);
        end if;
      end if;
      STATE_10 <= EXECUTE;
      PC_10 <= PC_10 + 1;
    end case;

    if RST = '1' then
      STATE_10 <= STALL;
      PC_10 <= "00000000";
      STREAM_5_ACK <= '0';
      STREAM_7_ACK <= '0';
      STREAM_1_ACK <= '0';
      STREAM_3_ACK <= '0';
      STREAM_0_STB <= '0';
      STREAM_2_STB <= '0';
      STREAM_8_STB <= '0';
      STREAM_9_STB <= '0';
    end if;
  end process;

  --subtractor
  REMAINDER_10 <= std_logic_vector(unsigned(SHIFTER_10) - resize(unsigned(B_10), 20));


end architecture RTL;